@import url('https://fonts.googleapis.com/css2?family=Archivo+Narrow&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Heebo&display=swap');

/*  General Adjustments  */
* {
    padding: 0;
    margin: 0;
}
html {
    box-sizing: border-box;
    scroll-behavior: smooth;
}
.hide_me {
    position:absolute;
    top:-10000px;
}
.home, .products, .about, .contact {
    height: 90vh;
    position: absolute;
    width: 100%;
}
.btn {
    font-family: Heebo,Helvetica,Arial,sans-serif;
    border: none;
    background-color: #8867a1;
    color: white;
    padding: 10px;
    margin: 10px 0;
    font-size: 16px;
    cursor: pointer;
}
.btn:hover {
    background-color: #b26ba5;
}

/*  Site Navigation  */
.mobile-nav {
    display: none;
}
.site-nav li, .site-nav a, .cart a {
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-weight: 500;
    font-size: 16px;
    color: #666;
    text-decoration: none;
}
.site-header {
    display: flex;
    justify-content: flex-end;
    align-items: center;
    padding: 30px 10% 30px 5%;
    background-color: white;
}
.site-header-logo {
    cursor: pointer;
    margin-right: auto;
}
.site-nav ul {
    list-style: none;
}
.site-nav li {
    display: inline-block;
    padding: 0 20px;
}
.site-nav li a {
    transition: all 0.3 ease 0s;
}
.site-nav li a:hover {
    color: #b26ba5;
}
.cart {
    margin-left: 20px;
    padding: 9px 25px;
    background-color: #8867a1;
    border: none;
    border-radius: 50px;
    cursor: pointer;
    transition: all 0.3 ease 0s;
    text-decoration: none;
    span {
        margin-left: 5px;
        font-family: Heebo,Helvetica,Arial,sans-serif;
    }
}
.cart:hover {
    background-color: #b26ba5;
}
.cart .fa-shopping-cart, .cart span {
    color: white;
}
.site-nav li .active {
    font-weight: bold;
}
.quick-links-container {
    padding: 0 16px;
    width: 100%;
    display: flex;
    flex-direction: row;
    border-bottom: solid 1px #ccc;
}
.quick-links-title {
    color: #000;
    font-size: 16px;
    font-weight: 600;
    font-family: Heebo, Helvetica, Arial, sans-serif;
}
.quick-links-menu {
    font-size: 12px;
    font-weight: 400;
    font-family: Heebo, Helvetica, Arial, sans-serif;
    align-self: center;
    margin-left: auto;
}
.ql-menu-items {
    list-style: none;
}
.ql-menu-item {
    display: inline-block;
    padding: 0 15px;
    a {
        text-decoration: none;
        color: #666;
    }
    .ql-buy-button {
        color: #fff;
    }
}
.ql-buy-button {
    cursor: pointer;
    padding: 4px 11px;
    border-radius: 12px;
    border: none;
    background-color: #8867a1;
}
.ql-buy-button:hover {
    background-color: #b26ba5;
}

/*  Home Page (index.html)  */
#home {
    margin: 0;
    height: 100%;
    -webkit-background-size: cover;
    background-size: cover;
    background-repeat:no-repeat;
    background-attachment: fixed;
    background-image: url(/images/KittyBG-min.png)
}
.home-content {
    height: 100%;
}
.home-content-wrapper {
    display: flex;
    flex-direction: column;
    flex-wrap: wrap;
    justify-content: space-between;
    position: relative;
    padding-top: 200px;
    max-width: 1024px;
    margin-right: auto;
    margin-left: auto;
}
.home-hero-title {
    padding-right: 50%;
    padding-bottom: 5rem;
    text-align: right;
    font-family: 'Archivo Narrow';
    font-weight: 700;
    font-style: normal;
    fill: #fff;
    color: #fff;
    font-size: 8.5714285714rem;
    letter-spacing: -.04em;
    line-height: .8916666667;
    box-sizing: inherit;
}
.home-hero-title-sub {
    text-align: right;
    font-size: 25px;
    padding-top:20px;
    letter-spacing: 0;
}
.home-hero-content {
    height: auto;
    width: 345px;
    margin-top: 0;
    margin-right: 60px;
    margin-left: auto;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-weight: 400;
    font-style: normal;
    color: #ffccff;
    font-size: 1rem;
    line-height: 1.7142857143;
}
.home-hero-content .lead {
    margin-bottom: 20px;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-weight: 300;
    font-style: normal;
    color: #fff;
    font-size: 1.6428571429rem;
    line-height: 1.52;
}
.home-hero-content ul {
    display: flex;
    margin-top: 68px;
    color: #fff;
    font-size: .7857142857rem;
    line-height: 1;
    list-style: none;
}
html:not(.user-is-tabbing) a, html:not(.user-is-tabbing) button {
    outline: none;
}
.home-hero-content a {
    color: inherit;
    text-decoration: none;
}
.home-hero-content li + li::before {
    content: "/";
    display: inline-block;
    margin-right: 10px;
    margin-left: 10px;
    vertical-align: middle;
}
.home-hero-title-main {
    font-size: 8.5714285714rem;
}

/*  Products Page (products.html)  */
.products {
    background-color: #f5f5f7;
}
.product-nav {
    background: #1d1d1f;
    padding-top: 8px;
    padding-bottom: 8px;
    text-align: center;
    height: 100px;
    width: 100%;
    position: relative;
    overflow: hidden;
    color: #f5f5f7;
}
.product-nav-wrapper {
    height: 100%;
}
.product-nav-items {
    padding-bottom: 49px;
    margin: 0 34px;
    overflow-x: auto;
    overflow-y: hidden;
    white-space: nowrap;
    list-style: none;
}
.product-nav-item {
    display: inline-block;
    vertical-align: top;
    padding: 20px 20px 0 20px;
}
.product-nav-link {
    display: flex;
    flex-direction: column;
    text-decoration: none;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    color: #f5f5f7;
}
.product-nav-link:hover {
    color: #2997ff;
}
.phone-section {
    background: #f5f5f7;
    padding: 3rem auto 6rem auto;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-weight: bold;
}
.phone-section-content {
    margin: auto;
    width: 100%;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding-top: 60px;
    padding-bottom: 2rem;
}
.phone-section-panel {
    text-align: center;
    color: #1d1d1f;
    h3 {
        font-size: 40px;
        font-family: 'Archivo Narrow';
    }
}
.watch-section {
    background: #000;
    padding: 3rem auto 5rem auto;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-weight: bold;
}
.watch-section-content {
    margin: auto;
    width: 100%;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding-top: 2rem;
    padding-top: 60px;
}
.watch-section-panel {
    text-align: center;
    color: #f5f5f7;
    h3 {
        font-size: 40px;
        font-family: 'Archivo Narrow';
    }
}
.link-container {
    margin-top: 2rem;
    margin-bottom: 2rem;
}
.learn-more {
    white-space: nowrap;
    text-decoration: none;
    font-size: 17px;
    line-height: 1.17648;
    min-width: 28px;
    padding-left: 16px;
    padding-right: 16px;
    padding-top: 8px;
    padding-bottom: 8px;
    border-radius: 980px;
    background: #0071e3;
    color: #fff;
}

/*  About Page (about.html)  */
.about {
    background-color: #1d1d1f;
}
.about-hero-title {
    padding-bottom: 5rem;
    padding-top: 5rem;
    text-align: center;
    font-family: 'Archivo Narrow';
    font-weight: 700;
    font-style: normal;
    fill: #fff;
    color: #fff;
    font-size: 5rem;
    line-height: .8916666667;
    box-sizing: inherit;
    background-image: url('../images/KittyBG-about.png');
    background-repeat: no-repeat;
    background-position: center; 
    position: relative;
}
.about-hero-title-sub {
    text-align: center;
    font-size: 2rem;
    padding-top:20px;
}
.about-hero-wrapper {
    background-color: #1d1d1f;
    height: 640px;
    display: flex;
    color: #f5f5f7;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-weight: 300;
    font-style: normal;
    text-align: center;
    h2 {
        font-family: 'Archivo Narrow';
    }
}
.about-card-one {
    width: 33.3%;
    padding-left: 2rem;
    padding-right: 2rem;
    box-sizing: inherit;
    background-color: #000;
    background-image: url('../images/wireframe-min.png');
    background-repeat: no-repeat;
    background-size: contain;
    background-position: center; 
    position: relative;
    display: flex;
    justify-content: center;
    align-items: center;
}
.about-card-two {
    width: 33.3%;
    padding-left: 2rem;
    padding-right: 2rem;
    box-sizing: inherit;
    background-color: #000;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-left: solid #666 1px;
    border-right: solid #666 1px;
}
.about-social ul {
    display: flex;
    align-items: center;
    justify-content: center;
    padding-top: 1rem;
    color: #fff;
    list-style: none;
}
.about-social li {
    margin: auto 1rem;
    cursor: pointer;
    a {
        display: flex;
        flex-direction: row;
        align-items: center;
        justify-content: center;
        text-decoration: none;
        color: #000;
    }
}
.about-card-three {
    width: 33.3%;
    padding-left: 2rem;
    padding-right: 2rem;
    box-sizing: inherit;
    background-color: #000;
    background-image: url('../images/back-min.png');
    background-repeat: no-repeat;
    background-size: contain;
    background-position: center; 
    position: relative;
    display: flex;
    justify-content: center;
    align-items: center;
}

/*  Phone / Watch Page (phone.html / watch.html)  */
.item-flex {
    display: flex;
    margin-top: 2rem;
}
.item-content {
    margin: 0 auto;
    max-width: 980px;
}
.item-imgs {
    width: 50%;
    img {
        width: 100%;
    }
}
.item-info {
    width: 50%;
}
.ctg-info-section {
    border: solid 1px #ccc;
    border-radius: 5px;
    padding: 15px;
    margin: 2rem auto;
    font-family: 'Archivo Narrow';
}
.item-ctg-flex, .item-color-flex {
    display: flex;
    margin-left: 15px;
    li {
        list-style: none;
        margin-left: 20px;
    }
    li p {
        padding-left: 5px;
    }
}
.item-ctg {
    border-bottom: solid 1px #ccc;
    margin-bottom: 10px;
}
.item-ctg-label {
    font-weight: 600;
}
.item-color-flex li{
    display: flex;
}
.item-button {
    width: 100%;
    margin: 0 auto;
    text-align: center;
}
.item-buy-button  {
    text-decoration: none;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    font-size: 20px;
    color: #FFFFFF;
    background-color: #8867a1;
    border: none;
    border-radius: 50px;
    cursor: pointer;
    padding: 5px 20%;
}
.item-buy-button:hover {
    background-color: #b26ba5;
}
.dot1, .dot2, .dot3, .dot4, .dot5 {
    height: 25px;
    width: 25px;
    border-radius: 50%;
    display: inline-block;
}
.dot1 {
background-color: #1d1b1b;
}
.dot2 {
background-color: #5b6091;
}
.dot3 {
background-color: #1c90ca;
}
.dot4 {
background-color: #FFFFFF;
border: solid 1px #ccc;
}
.dot5 {
    background-color: #cb1616;
}

/*  Cart Page (cart.html)  */
.cartpage-container {
    margin: 0 auto;
    max-width: 980px;
    h2 {
        font-size: 2rem;
    }
}
.stocks-container {
    display: flex;
    flex-wrap: wrap;
    padding-bottom: 100px;
    max-width: 650px;
    justify-content: space-around;
    margin: 0 auto;
    margin-top: 50px;
}
.stocks-container .fa-times-circle, .fa-chevron-circle-left , .fa-chevron-circle-right {
    color: #8867a1;
    margin: 0 10px;
    cursor: pointer;
}
.stocks-container .fa-times-circle:hover, .fa-chevron-circle-left:hover, .fa-chevron-circle-right:hover {
    color: #b26ba5;
}
.stock-header {
    width: 100%;
    max-width: 650px;
    font-family: 'Archivo Narrow';
    font-size: 12px;
    display: flex;
    justify-content: flex-start;
    border-bottom: 4px solid #ccc;
    margin: 0 auto;
}
.stock-title {
    width: 45%;
}
.price {
    width: 15%;
    display: flex;
    align-items: center;
}
.quantity {
    width: 30%;
    display: flex;
    align-items: center;
}
.total {
    width: 10%;
    display: flex;
    align-items: center;
}
.stock {
    width: 45%;
}
.stocks {
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    font-family: 'Archivo Narrow';
}
.basketTotalContainer {
    display: flex;
    justify-content: flex-end;
    width: 100%;
    padding: 10px 0;
}
.basketTotalTitle {
    width: 30%;
}
.basketTotal {
    width: 10%;
}
.cartpage-buttons {
    width: 100%;
    margin-top: 1rem;
    display: flex;
    flex-direction: row;
    justify-content: flex-end;
    a {
        font-family: Heebo,Helvetica,Arial,sans-serif;
        text-decoration: none;
        padding: 10px;
        margin: 15px;
    }
    form button {
        font-family: Heebo,Helvetica,Arial,sans-serif;
        text-decoration: none;
        padding: 10px;
        margin: 15px;
    }
}
.ctn-shopping {
    border: 4px solid #8867a1;
    border-radius: 50px;
    color: #8867a1;
}
.ctn-shopping:hover {
    border: 4px solid #b26ba5;
    color: #b26ba5;
}
.goto-checkout {
    border: 4px solid #8867a1;
    background-color: #8867a1;
    border-radius: 50px;
    color: white;
    font-size: 1rem;
    cursor: pointer;
}
.goto-checkout:hover {
    border: 4px solid #b26ba5;
    background-color: #b26ba5;
}

/*  Checkout Pages (checkout.html / payment.html)  */
.checkout-content, .payment-content {
    max-width: 980px;
    margin: 0 auto;
    border: 1px solid #ccc;
    h2 {
        font-family: Heebo,Helvetica,Arial,sans-serif;
        text-align: center;
    }
}
.checkout-form, .payment-form {
    max-width: 650px;
    margin: 0 auto;
}
.progress-container {
    width: 600px;
    margin: 100px auto; 
}
.progressbar {
    counter-reset: step;
}
.progressbar li {
    list-style-type: none;
    width: 25%;
    float: left;
    font-size: 12px;
    position: relative;
    text-align: center;
    text-transform: uppercase;
    color: #7d7d7d;
}
.progressbar li:before {
    width: 30px;
    height: 30px;
    content: counter(step);
    counter-increment: step;
    line-height: 30px;
    border: 2px solid #7d7d7d;
    display: block;
    text-align: center;
    margin: 0 auto 10px auto;
    border-radius: 50%;
    background-color: white;
}
.progressbar li:after {
    width: 100%;
    height: 2px;
    content: '';
    position: absolute;
    background-color: #7d7d7d;
    top: 15px;
    left: -50%;
    z-index: -1;
}
.progressbar li:first-child:after {
    content: none;
}
.progressbar li.active {
    color: #b26ba5;
}
.progressbar li.active:before {
    border-color: #b26ba5;
}
.progressbar li.active + li:after {
    background-color: #b26ba5;
}
label {
    display: block;
    font-family: Heebo,Helvetica,Arial,sans-serif;
}
fieldset
{
    margin: 0;
    padding: 0;
    border: none;
}
legend
{
    display: block;
    padding-top: 1rem;
    font-weight: bold;
    font-family: 'Archivo Narrow';
    font-size: 20px;
}
label, #firstname, #lastname, #streetaddress, #city, #state, #zipcode, #email, #phone, #cardname, #cardnumber, #expdate, #cardcode {
    margin-left: 2rem;
}

/*  Confirmation Page (confirmation.html)  */
.confirm-content {
    max-width: 980px;
    margin: 0 auto;
    border: 1px solid #ccc;
    h2 {
        font-family: Heebo,Helvetica,Arial,sans-serif;
        text-align: center;
    }
    img {
        max-width: 100%;
    }
}
.confirm-default {
    border-top: 1px solid #ccc;
    text-align: center;
    font-family: Heebo,Helvetica,Arial,sans-serif;
    h3 {
        font-family: 'Archivo Narrow'; 
        font-size: 2rem;
    }
}
.confirm-details {
    margin: 1rem auto;
    text-align: center;
    h3 {
        font-family: 'Archivo Narrow';
    }
    p {
        font-family: Heebo,Helvetica,Arial,sans-serif;
        font-size: 13px;
    }
}
.contact-mail {
    margin: 0 auto;
    margin-top: 15px;
    max-width: 300px;
}
.confirm-btn-center {
    text-align: center;
}

/* Breakpoint at 1044px */
@media screen and (max-width: 1044px) {

    /*  Home Page (index.html)  */

    .home-hero-title {
    max-width: 100%;
    padding: 0 0 5rem 0;
    margin-right: 35%;
    }
    .home-hero-content {
        max-width: 100%;
        margin: auto;
    }

    /*  About Page (about.html)  */
    .about-hero-wrapper {
        overflow: auto;
        flex-direction: column;
    }
    .about-card-one, .about-card-two, .about-card-three {
        padding: 0;
        margin: 0;
        width: 100%;
        height: 50%;
        .about-card-text {
            max-width: 100%;
            p {
                margin: auto 5rem;
            }
        }
    }
}

/* Breakpoint at 990px */
@media screen and (max-width: 990px) {

    /*  Phone / Watch Page (phone.html / watch.html)  */
    .item-content {
        max-width: 100%;
        padding: 0;
    }
    .quick-links-container {
        max-width: 100%;
        padding: 0;
    }
    .item-flex {
        flex-direction: column;
        align-items: center;
        margin: 3rem auto;
    }
    .item-info h2 {
        text-align: center;
        padding-top: 2rem;
    }
}

/* Breakpoint at 850px */
@media screen and (max-width: 850px) {

/*  Phone / Watch Page (phone.html / watch.html)  */
    .quick-links-container {
        flex-direction: column;
        padding-bottom: 1rem;
    }
    .quick-links-title {
        align-self: center;
    }
    .quick-links-menu {
        margin: 0;
    }
    .item-imgs, .item-info {
        width: 90%;
    }
}

/* Breakpoint at 700px */
@media screen and (max-width: 700px) {

    /*  Site Navigation  */
    .site-nav {
        display: none;
    }
    .mobile-nav {
        max-width: 100%;
        width: 100%;
        margin: 0 auto;
        display: flex;
        flex-direction: row;
        justify-content: center;
        background-color: #FFFFFF;
    }
    .mobile-nav nav a {
        font-family: Heebo,Helvetica,Arial,sans-serif;
        font-weight: 500;
        font-size: 16px;
        color: #8867a1;
        text-decoration: none;
        padding: 0 20px;
    }

    /*  Home Page (index.html)  */
    .home-content-wrapper {
        padding-top: 5rem;
        max-width: 100%;
        justify-content: flex-start;
    }
    .home-hero-title {
        margin: 0;
    }
    .home-hero-title-main {
        font-size: 5rem;
        text-align: center;
    }
    .home-hero-title-sub {
        text-align: center;
    }

    /*  Products Page (products.html)  */
    .phone-section-panel, .watch-section-panel {
        max-width: 100%;
    }
    .phone-section-panel img, .watch-section-panel img {
        max-width: 90%;
    }

    /*  Phone / Watch Page (phone.html / watch.html)  */
    .item-color-flex {
        flex-direction: column;
        margin-left: 15%;
        li {
            margin: 5px 0;
        }
    }

    /*  Cart Page (cart.html)  */
    .total {
        width: 10%;
    }
    .quantity {
        width: 25%;
    }
    .basketTotalContainer {
        width: 90%;
    }
    .basketTotalTitle {
        width: 35%;
    }
    .progress-container {
        width: 100%;
        max-width: 100%;
        margin: 0 auto;
    }

    /*  Checkout Pages (checkout.html / payment.html)  */
    .checkout-content, .payment-content {
        margin-left: 10px;
        border: none;
    }
}
